  ".es(index=kibana_sample_data_ecommerce, metric=sum:taxless_total_price, timefield=order_date)" interval="1w"
| mapColumn "value" fn={math "round(value,0)"}
| staticColumn "mean" value={math "round(mean(value),0)"}
| mapColumn "mean" "as" "rnd" fn={math "round(random(0.9,1.1),2)"}
| mapColumn "value" "as" "final" fn={math "round(multiply(rnd,mean),2)"}
| pointseries x="@timestamp" y="final"
| plot xaxis=false yaxis=false defaultStyle={seriesStyle points="0" bars="0" lines="3" color="#eb6c66"}
| render containerStyle={containerStyle opacity="0.5"}

